  input: TEXT,F3XN,,"October 16, 2003 Dear Mr. Koeppen, On behalf of the Motorola,
    Inc. Political Action Committee, I am hereby submitting this explanatory statement
    with our October 2003 Monthly Report. On August 14, 2003 and August 28, 2003,
    an error in our payroll system caused two erroneous deductions from the paycheck
    of one of our PAC contributors.  Specifically, the amount of $5,000 was erroneously
    deducted from Raymond Roman's paycheck on August 14, 2003.  Mr. Roman immediately
    contacted our payroll department regarding this error and received an electronic
    payroll credit of $4,947.12 on August 28, 2003.  Please note that $4,947.12 reflects
    the difference between the amount that was erroneously deducted from Mr. Roman's
    paycheck and his intended contribution of $52.88. Unfortunately, on August 28,
    2003, an erroneous electronic payroll deduction of $4,947.12 was also taken from
    Raymond Roman's paycheck.  To correct the August 28, 2003 erroneous deduction,
    Motorola's payroll department electronically credited $4,894.24 to his account
    on September 11, 2003.  This credited amount reflects the difference between the
    amount that was erroneously deducted from his paycheck and his intended contribution
    of $52.88.  Since a check was not cut from the PAC bank account, the payroll department
    transmitted the electronic credits as negative entries in our monthly payroll
    file. Pursuant to a September 9, 2003 conversation that our software vendor, Democracy,
    Data & Communications, had with Scott Walker, Senior Campaign Finance Analyst,
    disclosing the negative deduction representing the electronic fund transfer, Scott
    indicated that this explanatory statement was sufficient clarification. If you
    have any questions regarding this Monthly Report, please contact me at (847) 576-5306.
    Respectfully submitted, Bruce Forsberg Motorola, Inc. Political Action Committee
    Treasurer "
